import React from "react";
import recent from "./recent.jpg"
import './section1.css';
const Section1 = () => {
       return(
       <div className="body">
       <p className="recent">
        Recent Activities
       </p>
        <div className="horizontal-section">
      <div className="image-container">
        <img src="./recent.jpg" alt="Image" />
      </div>
      <div className="text-container">
        <p>Your text goes here. You can add more content as needed.</p>
      </div>
    </div>
    </div>
       )
}
export default Section1;
